import React, { Component } from 'react';

class Projects extends Component {

  constructor(props){
    super(props)
    this.state = {currentProject: ""}
  }

  render() {
	return(
	  <div className= "project"> 
		<h1>{this.props.name}</h1>
	  </div>
	)
  }
}

export default Projects
